import { useState, useRef, useEffect } from 'react';
import { BrowserRouter as Router, Routes, Route, useNavigate } from 'react-router-dom';
import { Canvas } from '@react-three/fiber';
import { Environment, OrbitControls, Text3D } from '@react-three/drei';  // Combined imports
import BodyModel from './components/BodyModel';
import DiagnosisPage from './components/DiagnosisPage';
import FeedbackPage from './components/FeedbackPage';
import './styles.css';


function Home() {
  const [selectedParts, setSelectedParts] = useState([]);
  const [painType, setPainType] = useState('');
  const [duration, setDuration] = useState('');
  const [severity, setSeverity] = useState(1);
  const [additional, setAdditional] = useState('');
  const [extraDetails, setExtraDetails] = useState('');
  const [medicalHistory, setMedicalHistory] = useState('');
  const [age, setAge] = useState('');
  const [gender, setGender] = useState('');
  const [followUpAnswer, setFollowUpAnswer] = useState('');
  const [error, setError] = useState(null);
  const [isLoading, setIsLoading] = useState(false);
  const [progress, setProgress] = useState(0);
  const navigate = useNavigate();
  const canvasRef = useRef();

  useEffect(() => {
    if (isLoading) {
      const interval = setInterval(() => {
        setProgress((prev) => (prev >= 90 ? 90 : prev + 10));
      }, 300);
      return () => clearInterval(interval);
    } else {
      setProgress(0);
    }
  }, [isLoading]);

  const handlePartClick = (partName) => {
    setSelectedParts((prev) => {
      if (prev.includes(partName)) {
        return prev.filter((part) => part !== partName);
      } else {
        return [...prev, partName];
      }
    });
    setError(null);
  };

  const handleNext = async () => {
    if (selectedParts.length === 0) {
      setError('Please select at least one body part.');
      return;
    }

    setIsLoading(true);
    setError(null);

    try {
      const payload = {
        locations: selectedParts,
        painType: painType || 'unspecified',
        duration: duration || 'unknown',
        severity: severity || 1,
        additional: additional || 'none',
        extraDetails: extraDetails || 'none',
        medicalHistory: medicalHistory || 'none',
        age: age || 'unspecified',
        gender: gender || 'unspecified',
        followUpAnswer: followUpAnswer || 'unspecified',
      };
      console.log('Sending diagnosis request:', payload);
      const response = await fetch('http://localhost:5001/diagnose', {
        method: 'POST',
        headers: {
          'Content-Type': 'application/json',
        },
        body: JSON.stringify(payload),
      });

      if (!response.ok) {
        const errorText = await response.text();
        console.error('Backend error response:', errorText);
        throw new Error(`Backend error: ${response.status} ${response.statusText} - ${errorText}`);
      }

      const data = await response.json();
      if (data.error) {
        throw new Error(data.error);
      }

      console.log('Diagnosis received:', data);
      setProgress(100);
      navigate('/diagnosis', { state: { diagnosis: data.diagnosis, recommendations: data.recommendations } });
    } catch (err) {
      console.error('Diagnosis error:', err);
      setError(`Failed to get diagnosis: ${err.message}`);
    } finally {
      setIsLoading(false);
    }
  };

  return (
    <div className="flex flex-row w-screen h-screen bg-gradient-to-br from-gray-50 to-gray-100">
      <div className="w-2/5 h-full border-2 border-gray-200 rounded-lg m-2 shadow-sm">
        <div className="text-center text-gray-700 font-semibold text-lg mt-1">BODY</div>
        <Canvas
          ref={canvasRef}
          camera={{ position: [0, 0, 10], fov: 50, near: 0.1, far: 100 }}
          gl={{ antialias: true }}
          shadows
          onCreated={() => console.log('Canvas initialized')}
        >
          <color attach="background" args={['#808080']} />
          <ambientLight intensity={0.8} />
          <directionalLight position={[10, 10, 10]} intensity={1.5} castShadow />
          <Environment preset="studio" />
          <BodyModel onPartClick={handlePartClick} selectedParts={selectedParts} />
          <OrbitControls
            enableZoom={true}
            enablePan={false}
            enableRotate={true}
            target={[0, 0, 0]}
            minDistance={2}
            maxDistance={15}
          />
        </Canvas>
      </div>
      <div className="w-3/5 p-4 m-2 border-2 border-gray-200 rounded-lg flex flex-col space-y-2 shadow-sm">
        <div className="text-gray-700 font-semibold text-lg">Click on pain points</div>
        <div className="grid grid-cols-2 gap-3">
          <label className="block">
            <span className="text-gray-700 font-medium text-sm">Body Parts</span>
            <input
              type="text"
              value={selectedParts.map(part => part.replace(/_/g, ' ')).join(', ')}
              readOnly
              placeholder="Click model to select"
              className="mt-1 w-full p-1.5 border border-gray-200 rounded-md bg-white text-gray-700 text-sm focus:outline-none focus:ring-2 focus:ring-blue-300 shadow-sm"
            />
          </label>
          <label className="block">
            <span className="text-gray-700 font-medium text-sm">Pain Type</span>
            <input
              type="text"
              value={painType}
              onChange={(e) => setPainType(e.target.value)}
              placeholder="e.g., sharp, dull"
              className="mt-1 w-full p-1.5 border border-gray-200 rounded-md text-gray-700 text-sm focus:outline-none focus:ring-2 focus:ring-blue-300 shadow-sm"
            />
          </label>
          <label className="block">
            <span className="text-gray-700 font-medium text-sm">Duration(Days)</span>
            <input
              type="text"
              value={duration}
              onChange={(e) => setDuration(e.target.value)}
              placeholder="e.g., 2 days"
              className="mt-1 w-full p-1.5 border border-gray-200 rounded-md text-gray-700 text-sm focus:outline-none focus:ring-2 focus:ring-blue-300 shadow-sm"
            />
          </label>
          <label className="block">
            <span className="text-gray-700 font-medium text-sm">Pain Severity (1-10)</span>
            <div className="flex items-center mt-1">
              <input
                type="range"
                min="1"
                max="10"
                value={severity}
                onChange={(e) => setSeverity(parseInt(e.target.value))}
                className="w-full h-2 bg-gray-200 rounded-lg appearance-none cursor-pointer"
              />
              <span className="ml-3 text-gray-700 font-medium text-sm">{severity}</span>
            </div>
          </label>
          <label className="block">
            <span className="text-gray-700 font-medium text-sm">Age</span>
            <input
              type="number"
              value={age}
              onChange={(e) => setAge(e.target.value)}
              placeholder="e.g., 30"
              className="mt-1 w-full p-1.5 border border-gray-200 rounded-md text-gray-700 text-sm focus:outline-none focus:ring-2 focus:ring-blue-300 shadow-sm"
            />
          </label>
          <label className="block">
            <span className="text-gray-700 font-medium text-sm">Gender</span>
            <select
              value={gender}
              onChange={(e) => setGender(e.target.value)}
              className="mt-1 w-full p-1.5 border border-gray-200 rounded-md text-gray-700 text-sm focus:outline-none focus:ring-2 focus:ring-blue-300 shadow-sm"
            >
              <option value="">Select gender</option>
              <option value="male">Male</option>
              <option value="female">Female</option>
              <option value="other">Other</option>
            </select>
          </label>
          {selectedParts.length > 0 && (
            <label className="block">
              <span className="text-gray-700 font-medium text-sm">Does the pain worsen with movement?</span>
              <select
                value={followUpAnswer}
                onChange={(e) => setFollowUpAnswer(e.target.value)}
                className="mt-1 w-full p-1.5 border border-gray-200 rounded-md text-gray-700 text-sm focus:outline-none focus:ring-2 focus:ring-blue-300 shadow-sm"
              >
                <option value="">Select an option</option>
                <option value="yes">Yes</option>
                <option value="no">No</option>
              </select>
            </label>
          )}
          <label className="block">
            <span className="text-gray-700 font-medium text-sm">Additional Symptoms</span>
            <input
              type="text"
              value={additional}
              onChange={(e) => setAdditional(e.target.value)}
              placeholder="e.g., swelling"
              className="mt-1 w-full p-1.5 border border-gray-200 rounded-md text-gray-700 text-sm focus:outline-none focus:ring-2 focus:ring-blue-300 shadow-sm"
            />
          </label>
          <label className="block">
            <span className="text-gray-700 font-medium text-sm">Extra Details</span>
            <textarea
              value={extraDetails}
              onChange={(e) => setExtraDetails(e.target.value)}
              placeholder="e.g., swelling, redness"
              className="mt-1 w-full p-1.5 border border-gray-200 rounded-md text-gray-700 text-sm focus:outline-none focus:ring-2 focus:ring-blue-300 h-10 resize-none shadow-sm"
            />
          </label>
          <label className="block">
            <span className="text-gray-700 font-medium text-sm">Medical History</span>
            <textarea
              value={medicalHistory}
              onChange={(e) => setMedicalHistory(e.target.value)}
              placeholder="e.g., previous injuries, chronic conditions"
              className="mt-1 w-full p-1.5 border border-gray-200 rounded-md text-gray-700 text-sm focus:outline-none focus:ring-2 focus:ring-blue-300 h-10 resize-none shadow-sm"
            />
          </label>
        </div>
        {isLoading && (
          <div className="w-full bg-gray-200 rounded-full h-2 mt-2">
            <div
              className="bg-blue-500 h-2 rounded-full transition-all duration-300"
              style={{ width: `${progress}%` }}
            ></div>
          </div>
        )}
        <button
          onClick={handleNext}
          disabled={isLoading}
          className={`w-full p-2 mt-2 text-white rounded-md font-medium transition-all duration-300 shadow-sm ${
            isLoading ? 'bg-blue-400 cursor-not-allowed' : 'bg-blue-500 hover:bg-blue-600 hover:shadow-md'
          }`}
        >
          {isLoading ? 'Loading...' : 'Next'}
        </button>
        {error && <p className="mt-1 text-red-600 font-medium text-sm">{error}</p>}
      </div>
    </div>
  );
}

function FloatingShapes() {
  const shapes = useRef([]);
  const group = useRef();

  useFrame((state) => {
    shapes.current.forEach((shape, i) => {
      shape.position.y = Math.sin(state.clock.getElapsedTime() + i * 0.5) * 0.5;
      shape.rotation.x += 0.01;
      shape.rotation.y += 0.01;
    });
    if (group.current) {
      group.current.rotation.y += 0.002;
    }
  });

  const shapesData = [
    { shape: 'box', color: '#4f46e5', size: [0.8, 0.8, 0.8], position: [2, 0, 0] },
    { shape: 'sphere', color: '#10b981', size: [0.6, 32, 32], position: [-2, 0, 0] },
    { shape: 'torus', color: '#f59e0b', size: [0.5, 0.2, 16, 32], position: [0, 0, 2] },
    { shape: 'cone', color: '#ef4444', size: [0.6, 1, 32], position: [0, 0, -2] },
    { shape: 'octahedron', color: '#8b5cf6', size: [0.7, 0], position: [1.5, 0, 1.5] },
    { shape: 'tetrahedron', color: '#ec4899', size: [0.7, 0], position: [-1.5, 0, -1.5] },
  ];

  return (
    <group ref={group}>
      {shapesData.map((data, i) => {
        let geometry;
        switch (data.shape) {
          case 'box':
            geometry = <boxGeometry args={data.size} />;
            break;
          case 'sphere':
            geometry = <sphereGeometry args={data.size} />;
            break;
          case 'torus':
            geometry = <torusGeometry args={data.size} />;
            break;
          case 'cone':
            geometry = <coneGeometry args={data.size} />;
            break;
          case 'octahedron':
            geometry = <octahedronGeometry args={data.size} />;
            break;
          case 'tetrahedron':
            geometry = <tetrahedronGeometry args={data.size} />;
            break;
          default:
            geometry = <boxGeometry args={data.size} />;
        }

        return (
          <mesh
            key={i}
            ref={(el) => (shapes.current[i] = el)}
            position={data.position}
            castShadow
            receiveShadow
          >
            {geometry}
            <meshStandardMaterial color={data.color} roughness={0.2} metalness={0.5} />
          </mesh>
        );
      })}
    </group>
  );
}

function CenterText({ visible }) {
  return (
    <group position={[0, 0, 0]}>
      <Text3D
        font="/fonts/helvetiker_regular.typeface.json"
        size={0.5}
        height={0.1}
        curveSegments={12}
        bevelEnabled
        bevelThickness={0.02}
        bevelSize={0.02}
        bevelOffset={0}
        bevelSegments={5}
        position={[0, 0.5, 0]}
      >
        WellBot.AI
        <meshStandardMaterial color="#ffffff" metalness={0.8} roughness={0.2} />
      </Text3D>
      <Text3D
        font="/fonts/helvetiker_regular.typeface.json"
        size={0.2}
        height={0.05}
        curveSegments={12}
        position={[0, -0.2, 0]}
      >
        Tap Type Treat
        <meshStandardMaterial color="#d1d5db" metalness={0.5} roughness={0.3} />
      </Text3D>
    </group>
  );
}

function SplashScreen({ onComplete }) {
  const [textVisible, setTextVisible] = useState(false);
  const [fadeOut, setFadeOut] = useState(false);

  useEffect(() => {
    const textTimer = setTimeout(() => setTextVisible(true), 1000);
    const fadeTimer = setTimeout(() => setFadeOut(true), 3000);
    const completeTimer = setTimeout(onComplete, 4000);

    return () => {
      clearTimeout(textTimer);
      clearTimeout(fadeTimer);
      clearTimeout(completeTimer);
    };
  }, [onComplete]);

  return (
    <div className={`fixed inset-0 z-50 flex items-center justify-center transition-opacity duration-1000 ${fadeOut ? 'opacity-0' : 'opacity-100'}`}>
      <Canvas shadows camera={{ position: [0, 0, 8], fov: 50 }}>
        <color attach="background" args={['#111827']} />
        <ambientLight intensity={0.5} />
        <pointLight position={[10, 10, 10]} intensity={1} castShadow />
        <spotLight
          position={[0, 10, 0]}
          angle={0.15}
          penumbra={1}
          intensity={1}
          castShadow
          shadow-mapSize={[2048, 2048]}
        />
        <FloatingShapes />
        {textVisible && <CenterText />}
        <OrbitControls enableZoom={false} enablePan={false} autoRotate autoRotateSpeed={0.5} />
      </Canvas>
    </div>
  );
}

export default function App() {
  const [showSplash, setShowSplash] = useState(true);
  const [fadeIn, setFadeIn] = useState(false);

  useEffect(() => {
    if (!showSplash) {
      const timer = setTimeout(() => setFadeIn(true), 100);
      return () => clearTimeout(timer);
    }
  }, [showSplash]);

  return (
    <>
      {showSplash && <SplashScreen onComplete={() => setShowSplash(false)} />}
      <div className={`transition-opacity duration-1000 ease-in ${fadeIn ? 'opacity-100' : 'opacity-0'}`}>
        <Router>
          <Routes>
            <Route path="/" element={<Home />} />
            <Route path="/diagnosis" element={<DiagnosisPage />} />
            <Route path="/feedback" element={<FeedbackPage />} />
          </Routes>
        </Router>
      </div>
    </>
  );
}
